import React from "react";
import portrait from './portfolio.jpeg';
import { StyledAbout } from "./About.styled";
import { StyledButton } from "/home/khanna/Desktop/Productive/SelfProjects/Portfolio/Portfolio (Main)/src/components/Button/Button.styled.js";
import { NavLink } from "react-router-dom";
const About = () => {
  return (
    <StyledAbout>
      <h1 className="heading">ABOUT.</h1>
      <h2 className="subheading">INSPIRED BY DIFFERENCE.</h2>
      <div className="container">
        <div class="text">
          <p>
            Parturient montes, nascetur ridiculus mus. Maecenas ac finibus
            turpis. Vivamus et elit in leo pretium pharetra. Sed lobortis urna
            turpis, id ultricies dolor pharetra ac. Proin suscipit odio non
            libero ullamcorper, sit amet tincidunt lacus porta. Aenean sodales
            lectus ex, non sagittis nibh ultricies at. Aliquam nec dolor
            posuere, vulputate mauris at, fermentum Donec ligula metus
          </p>
        </div>
        <div class="photo">
          <img src={portrait} alt="phosto" />
        </div>
      </div>
      <div className="about">
        <StyledButton>
          <NavLink to="/">skills</NavLink>
        </StyledButton>
      </div>
    </StyledAbout>
  );
};
export default About;
